    add: function (char) { //create new object
        var x = CURSOR.select.x - YOU.x; //eventually this should take an x,y,z as well as a char, not just cursor info
        var y = CURSOR.select.y - YOU.y;
        var z = CURSOR.select.z - YOU.z;
        var color = CURSOR.select.color;

        TILES.array[TILES.array.length] = {char:char,color:color,x:x,y:y,z:z};
    },
    
    break: function () {

        const tile = CURSOR.tile;
        const birdIndex = TILES.array.indexOf(tile);

        TILES.array.splice(birdIndex, 1);

    },
    
    sortByDistance: function(array) {
        
        
        var rotatedXY = RENDER.rotate(0,0,0,30,-RENDER.rotation+180);
        var newPoint = {x:0,y:0};
        newPoint.x = rotatedXY[0];
        newPoint.y = rotatedXY[1];
        
        for (a = 0; a < array.length; a++) {
            array[a].distance = RENDER.distance({x:newPoint.x,y:newPoint.y}, {x:array[a].x,y:array[a].y});
        }
        
        var newArray = array;
        
        //Outer pass
        for(let i = 0; i < newArray.length; i++) {

            //Inner pass
            for(let j = 0; j < newArray.length - i - 1; j++){

                //Value comparison using ascending order

                if(newArray[j + 1].distance > newArray[j].distance){

                    //Swapping
                    [newArray[j + 1],newArray[j]] = [newArray[j],newArray[j + 1]]
                }
                else if (newArray[j + 1].distance == newArray[j].distance && newArray[j + 1].z < newArray[j].z) {
                    //Swapping
                    [newArray[j + 1],newArray[j]] = [newArray[j],newArray[j + 1]]
                }
            }
        }
        
        array = newArray;
        
    },
    
